    public static void guardar() {

        ArrayList<Profesional> profesionals = new ArrayList<>();
        try {
            JSONArray jsonArray = new JSONArray(json);
            for (int i=0; i<jsonArray.length() ; i++){
                JSONObject jsonObject = jsonArray.getJSONObject(i);

                Profesional profesional = new Profesional();

                profesional.setName(jsonObject.getString("nombre"));

                ArrayList<String> phones = new ArrayList<>();
                phones.add(jsonObject.getString("telefono"));
                profesional.setPhones(phones);

                int superCat = jsonObject.getInt("supercat");
                int subCat = jsonObject.getInt("subcat");
                ArrayList<String> professions = new ArrayList<>();
                String category = ProfessionsHelper.convertPositionToProfession(superCat, subCat);
                professions.add(category);
                profesional.setProfessions(professions);

                profesional.setPositionInLatLng(getLatLng(jsonObject.getInt("zona")));
                profesionals.add(profesional);
            }
        } catch (JSONException e) {
            e.printStackTrace();
        }
        guardarEnFirebase(profesionals);

    }

    public static void guardarEnFirebase (ArrayList<Profesional> profesionals){
            for (Profesional profesional : profesionals) {
                //Subir el profesional a la base
                FirebaseDatabase database = FirebaseDatabase.getInstance();
                final DatabaseReference databaseRef = database.getReference().child(PROFESIONALES).push();
                profesional.setId(databaseRef.getKey());
                databaseRef.setValue(profesional);

                //Asociar la posicion con GeoFire
                DatabaseReference geoRef = database.getReference(PROFESSIONAL_POSITION);
                GeoFire geoFire = new GeoFire(geoRef);
                LatLng pos = profesional.getPositionInLatLng();
                geoFire.setLocation(databaseRef.getKey(), new GeoLocation(pos.latitude, pos.longitude));

                //Por cada profesion agregar el key a la base "profession_x"
                for (Object professionId : profesional.getProfessions()) {
                    DatabaseReference professionRef = database.getReference(PROFESSION + "_" + String.valueOf(professionId));
                    professionRef.child(databaseRef.getKey()).setValue(true);
                }
            }
    }


    public static LatLng getLatLng (int zone){
        if (zone == 0){
            return new LatLng(-34.7935, -58.361996);
        }else if (zone == 1){
            return new LatLng(-34.637729, -58.666866);
        }else{
            return new LatLng(-34.508752, -58.552467);
        }
    }

